s.x:
var $bm_rt;
var strokeW, L1, L2, p1, p2, dist;
strokeW = 1;
L1 = thisComp.layer('Calque de forme 16');
L2 = thisComp.layer('Calque de forme 5');
p1 = L1.toWorld(L1.anchorPoint);
p2 = L2.toWorld(L2.anchorPoint);
dist = length($bm_sub(p2, p1));
$bm_rt = [
    dist,
    strokeW
];

p.x:
var $bm_rt;
var L1, p1;
L1 = thisComp.layer('Calque de forme 16');
$bm_rt = p1 = L1.toWorld(L1.anchorPoint);

r.x:
var $bm_rt;
var L1, L2, p1, p2, u, a;
L1 = thisComp.layer('Calque de forme 16');
L2 = thisComp.layer('Calque de forme 5');
try {
    p1 = L1.toWorld(L1.anchorPoint);
    p2 = L2.toWorld(L2.anchorPoint);
    u = $bm_sub(p2, p1);
    a = Math.atan2(u[1], u[0]);
    $bm_rt = radiansToDegrees(a);
} catch (e) {
    $bm_rt = value;
}

